ATTRIBUTE.VALUE:
CALL COLLECT_STATS_WRAP('$$TRANSLATIONDB','SM_BKG_SLS_MOTION_ATTRIBUTION','D');
/* Adding below code as part of SMR Aug 16th release to prevent split issue records loading into MT BKG table */ DELETE FROM $$STGDB.WI_MT_BKG_SPLIT_CHECK WHERE DV_TRX_TYPE = 'AR_N' ;
INSERT INTO $$STGDB.WI_MT_BKG_SPLIT_CHECK SELECT SM.SK_SALES_MOTION_ATTRIB_KEY SK_SALES_MOTION_ATTRIB_KEY, WI.DV_TRX_TYPE, SUM(DV_ALLOCATION_PCT) DV_ALLOCATION_PCT_SUM FROM $$STGDB.WI_SLS_MOTION_ATTRIB_AR_NAPLD WI INNER JOIN $$ETLVWDB.SM_BKG_SLS_MOTION_ATTRIBUTION SM ON WI.AR_TRX_LINE_KEY = SM.DV_TRANSACTION_ID AND WI.DV_ENTERPRISE_INV_SKU_ID = SM.DV_ENTERPRISE_INV_SKU_ID AND WI.DV_TRX_TYPE= SM.DV_TRX_TYPE GROUP BY 1,2 HAVING ROUND(SUM(DV_ALLOCATION_PCT),4) <> 1.0000 ;
COLLECT STATS ON $$STGDB.WI_MT_BKG_SPLIT_CHECK ;
DELETE FROM $$EXCEPDB.EX_MT_BKG_SLS_MOTION_ATTRIB EX WHERE EXISTS ( SEL 1 FROM $$STGDB.WI_SLS_MOTION_ATTRIB_AR_NAPLD WI WHERE WI.AR_TRX_LINE_KEY = EX.DV_TRANSACTION_ID AND WI.DV_ENTERPRISE_INV_SKU_ID = EX.DV_ENTERPRISE_INV_SKU_ID AND WI.DV_TRX_TYPE= EX.DV_TRX_TYPE) ;
INSERT INTO $$EXCEPDB.EX_MT_BKG_SLS_MOTION_ATTRIB SELECT SM.SK_SALES_MOTION_ATTRIB_KEY ,RANDOM(1010000,1011800)*-1 AS SALES_ORDER_LINE_KEY , WI.AR_TRX_LINE_KEY AS DV_TRANSACTION_ID , SM.DV_TRX_TYPE , WI.SALES_MOTION_CD , WI.START_TV_DTM , WI.END_TV_DTM , WI.DV_ENTERPRISE_INV_SKU_ID , WI.DV_ALLOCATION_PCT , WI.DV_SERVICE_CATEGORY_CD , WI.DV_OA_FLG ,WI.DV_SOURCE_TYPE AS DV_SOURCE_TYPE ,'UNKNOWN' AS AS_ARCHITECTURE_NAME ,'UNKNOWN' AS TECHNOLOGY_GROUP_ID ,'UNKNOWN' AS ATTR_PRDT_OFFER_TYPE_NAME ,'UNK' AS AS_TS_CODE ,-999 AS SK_RENEW_CONTRACT_LINE_ID , -999 AS SK_AS_PARENT_INVENTORY_ITEM_ID , -9999 AS SK_OFFER_ATTRIBUTION_ID_INT ,USER AS EDW_UPDATE_USER ,CURRENT_TIMESTAMP(0) AS EDW_CREATE_DTM ,CURRENT_TIMESTAMP(0) AS EDW_UPDATE_DTM ,USER AS EDW_CREATE_USER , RANDOM(1010000,1011800)*-1 AS SALES_ORDER_KEY ,WI.DV_ENTERPRISE_INV_SKU_ID AS SRC_ENTERPRISE_INV_SKU_ID , 'UNKNOWN' AS PRODUCT_CLASS , -999 AS TRANSACTION_CR_PARTY_KEY , -999 AS HQ_CR_PRTY_KEY , 'UNKNOWN' AS RENEWAL_REF_ID , 'UNKNOWN' AS RENEWAL_REF_CD , SLS_MTN_CORRECTION_REASON_DESC AS SMR_TAGGING_FAILURE_RSN_CD , WI.SALES_MOTION_TIMING_CD ,MANUAL_OVERRIDE_ROLE ,REQUESTING_CSCO_WRKR_PRTY_KEY ,SLS_MTN_CORRECTION_CASE_NUM ,SLS_MTN_CORRECTION_CMNT FROM $$STGDB.WI_SLS_MOTION_ATTRIB_AR_NAPLD WI INNER JOIN $$ETLVWDB.SM_BKG_SLS_MOTION_ATTRIBUTION SM ON WI.AR_TRX_LINE_KEY = SM.DV_TRANSACTION_ID AND WI.DV_ENTERPRISE_INV_SKU_ID = SM.DV_ENTERPRISE_INV_SKU_ID AND WI.DV_TRX_TYPE= SM.DV_TRX_TYPE AND EXISTS ( SEL 1 FROM $$STGDB.WI_MT_BKG_SPLIT_CHECK CHK WHERE SM.SK_SALES_MOTION_ATTRIB_KEY = CHK.SK_SALES_MOTION_ATTRIB_KEY AND CHK.DV_TRX_TYPE = 'AR_N' ) ;
COLLECT STATS ON $$EXCEPDB.EX_MT_BKG_SLS_MOTION_ATTRIB ;
DELETE FROM $$STGDB.WI_SLS_MOTION_ATTRIB_AR_NAPLD WI WHERE EXISTS ( SEL 1 FROM $$EXCEPDB.EX_MT_BKG_SLS_MOTION_ATTRIB EX WHERE WI.AR_TRX_LINE_KEY = EX.DV_TRANSACTION_ID AND WI.DV_ENTERPRISE_INV_SKU_ID = EX.DV_ENTERPRISE_INV_SKU_ID AND WI.DV_TRX_TYPE= EX.DV_TRX_TYPE ) ;
